  [],\n\t\"revision_timestamp\": \"2015-05-07T01:00:02.145402\",\n\t\"name\": \"silicon-microchannel-plate-large-area-uv-detector-project-e2155\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"To address the NASA need for high-quantum-efficiency,
  high-resolution, low-cost photodetectors for the far-UV spectral range, Physical
  Optics Corporation (POC) proposes to develop a new Silicon Microchannel Plate-based
  Large Area UV detector (UV-Si-MCP) with a highly efficient, negative electron affinity
  (NEA), solar-blind AlGaN photocathode fabricated directly on the surface of a silicon-based
  microchannel substrate. In Phase I, POC demonstrated the feasibility of fabrication
  of the AlGaN photocathode on the MCP structure, and developed the technology for
  fabrication of the entire device that meets NASA specifications for the area of
  sensitivity, quantum efficiency, and spatial resolution. In Phase II, POC will develop
  a fully functional prototype with a large number of channels and high quantum efficiency,
  assembled with NASA active pixel readout electronics. This efficient and radiation-hard
  UV photodetector with low background noise will offer NASA capabilities to improve
  sensitivity and spatial or spectral resolution of UV instruments for several missions
  devoted to a better understanding of the origin of the universe and its evolution
  to modern form. \",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
